CREATE VIEW public.pokemon_with_type AS
 SELECT p.id,
    p.identifier,
    t.identifier AS type,
    c.identifier AS color,
    s.identifier AS shape
   FROM (((((public.pokemon p
     JOIN public.pokemon_types pt ON ((p.id = pt.id)))
     JOIN public.types t ON ((pt.type_id = t.id)))
     JOIN public.pokemon_species ps ON ((p.species_id = ps.id)))
     JOIN public.pokemon_colors c ON ((ps.color_id = c.id)))
     JOIN public.pokemon_shapes s ON ((ps.shape_id = s.id)));


